import { FaTimes } from 'react-icons/fa'
import Task from './Task'

const Tasks = ({ task, onDelete }) => {
  return (
    <div className="task">
        <h3>{task.text}
        <FaTimes
        style={{color: 'red',
        cursor: 'pointer'}}
        onClick = {() => onDelete(task.id)}/></h3>
        <p>{task.day}</p>
    </div>
  )
} 

export default Tasks
